import styled from "styled-components";

// Styled component definition
const Container = styled.div`
    background-size: cover;
    min-height: 100vh;
    background-color: #f5d0fe;
    display: flex;
    justify-content: center;
    align-items: center;
`;

const ChildContainer = styled.div`
    background-size: cover;
    min-height: 100vh;
    background-color: #f5d0fe;
    display: flex;
    justify-content: center;
    align-items: center;
`;

// Functional component using the styled component
const App = () => {
    return (
        <Container>
            <ChildContainer>hi</ChildContainer>
        </Container>
    );
};

// Exporting the App component
export default App;
